import React from "react";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap-icons/font/bootstrap-icons.css';
import "./profile.css";

const ProfileComponent = () => {
    const profile = useSelector(state => state.profile);
    return(
        <div className="row">
            <div className="col-12 position-relative">
                <div className="position-relative mb-2">
                    <img src={`/images/${profile.bannerPicture}`} alt="skimag" className="w-100"/>
                </div>
                <div>
                    <span className="tuit-topic">
                        {profile.firstName} {profile.lastName}
                    </span>
                </div>
                <div>
                    <span className="">
                        {profile.handle} 
                    </span>
                </div>
                <div className="tuit-bio">
                    {profile.bio} 
                </div>
                <div class="s2-g">
                        <div className = "s2-g-links">
                                <div className="s2-g-icons">         
                                    <Link to="#"><i className="far fa-comment fg-color-black" ></i></Link> 
                                    <span className ="wd-s2-g-numbers">{profile.location}</span>
                                </div>
                                <div className="s2-g-icons">                                  
                                    <Link to="#"><i className="fa fa-retweet fg-color-black" ></i></Link> 
                                    <span class ="wd-s2-g-numbers">{profile.dateOfBirth}</span>
                                </div>
                                <div className="s2-g-icons">
                                    <Link to="#"><i className="fa fa-retweet fg-color-black" ></i></Link> 
                                    <span class ="wd-s2-g-numbers">{profile.dateJoined}</span>
                                </div>
                        </div>
                        <div>
                            <span className="tuit.number">
                                {profile.followingCount}
                            

                            </span>
                        </div>
                </div>
            </div>
        </div>
    );
}
export default ProfileComponent;
